import React, { Component } from "react";
import Photo from "./Photo";
import axios from "axios";

class Gallery extends Component {
	constructor(props) {
		super(props);
		this.state = {
			images: this.getData(),
			image: "",
			title: "",
		};
		this.state.images = this.state.images.bind(this);
	}

	getData() {
		axios
			.get("https://api.harvardartmuseums.org/image?apikey=221b4e10-7bc5-11ea-8865-8f439f2941d8")
			.then((res) => res.data)
			.then((data) => this.setState({ images: data.records }));
	}

